import React from 'react';
import Sidebar from './Sidebar';
import WebPlayerNew from './WebPlayerNew';
import Streaming from './Streaming';

//scss files
import '../style/sass/components/base.scss'
import '../style/sass/components/webplayer.scss'

class HomeContainer extends React.Component{


  render(){
    console.log('Home Container props', this.props);
    return(
      <div className="container">
        <WebPlayerNew user={this.props.user} currentPlaylist={this.props.currentPlaylist} selectedPlaylistCard={this.props.selectedPlaylistCard} handleClickForPostingSongToWebplayer={this.handleClickForPostingSongToWebplayer} addPlayistToUser={this.addPlayistToUser}/>
        <Streaming/>
      </div>
    )
  }
}
export default HomeContainer;
